import java.util.*;
import java.io.*;
class  Main {
    static Scanner sc = new Scanner(System.in);
    static StringBuilder sb = new StringBuilder();
    public static void main(String[] args) {
        int n = sc.nextInt();
        int k = sc.nextInt();
        long [] a  = new long[n];
        long [] b = new long[n];
        long sumA  = 0 ;
        long sumB = 0;
        for(int i = 0; i < a.length;i++){
            a[i] = sc.nextLong();
            sumA += a[i];
        }
        for(int i = 0 ; i < b.length;i++){
            b[i] = sc.nextLong();
            sumB += b[i];
        }
        if(Math.abs(sumA - sumB) > k ){
            System.out.println("NO");
        }else{
            Arrays.sort(a);
            Arrays.sort(b);
            boolean isDoable =true;
            int count = 0;
            int i = 0 ;
            int j = 0 ;
            while(i < a.length && j < b.length){
                    if(a[i] > b[j]){
                        if(a[i] - b[j] <= k){
                            count++;
                        }
                        if(count > 1){
                            isDoable = false;
                            break;
                        }
                        j++;
                    }else if( a[i] < b[j]){
                        i++;
                    }
                    else{
                        i++;
                        j++;
                    }
            }
            if(isDoable){
                System.out.println("YES");
            }else{
                System.out.println("NO");
            }
        }


    }
}
